var b="url",c="购物车.html",d="generationDate",e=new Date(1577265641916.4),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="page",s="packageId",t="641e235794b7492ea8930d02fde1c477",u="type",v="Axure:Page",w="购物车",x="notes",y="annotations",z="fn",A="1",B="ownerId",C="787c37f80b934ae284b8f6ee037ac89b",D="label",E="猜您喜欢",F="说明",G="<p><span>推荐商品为随机100款，每次进入该页面商品进行变化</span></p><p><span><br></span></p><p><span>商品展示样式及字段同商品列表页</span></p>",H="2",I="7178c594589a47abbf5887d22cc8c542",J="结算（3）",K="<p><span>未勾选商品点击结算提示“您还未勾选商品哦”</span></p><p><span><br></span></p><p><span>未勾选商品结算按钮上不显示对应商品数量</span></p><p><span>已勾选显示对应勾选商品件数（例1个商品购买5个 结算（5）</span></p><p><span>全选显示全部下单商品数</span></p><p><span><br></span></p><p><span>整条固定不随页面上下滑动</span></p><p><span><br></span></p>",L="3",M="f1edf9a3ce534586b04a4311b25b9692",N="太空了，快去挑选吧",O="<p><span>点击“挑选”跳转首页</span></p>",P="4",Q="fe3fcc76c51447e696a6de5cc4dfac22",R="(形状)",S="<p><span>由商品详情页进入购物车有返回按钮可点击 返回商品详情页</span></p><p><span>由tab进入购物车无返回按钮</span></p>",T="5",U="af328f6310dd4b9c8c25f02c1805bd93",V="<p><span>显示有效商品的数量（按商品计，一件商品购买N个，计为1）</span></p><p><span>购物车为空时不显示</span></p>",W="6",X="8715678c72034663bde82db65da2097f",Y="(复选框)",Z="<p><span>由商品页面加入购物车的商品 默认显示为勾选状态</span></p><p><span>勾选时：点击可取消勾选</span></p><p><span>未勾选时：点击可勾选</span></p><p><span><br></span></p>",ba="7",bb="7031b800ebe148999a63b3388b9a6c72",bc="<p><span>显示购物车商品种类总数，最大不超过99</span></p><p><span><br></span></p><p><span style=\"color:#D9001B;\">列表排序</span></p><p><span style=\"color:#D9001B;\"><br></span></p><p><span>多家商户商品在购物车不归类，按加入购物车时间倒序排列，最新增加的商品显示在第一位</span></p>",bd="8",be="612be0a799544eada1464e694c32dd29",bf="购物车列表",bg="<p><span>显示内容：</span></p><p><span>1.商品名称&nbsp; 最多一行，显示不全...</span></p><p><span>2.已选规格，可点击重新 选择</span></p><p><span>3.商品数量： 可编辑</span></p><p><span>4.商品价格：对应规格商品价格</span></p><p><span><br></span></p><p><span>点击：可进入该商品展示页面</span></p><p><span>右滑动：该商品出现“删除”按钮</span></p><p><span><br></span></p><p><span style=\"font-family:'Nunito Sans Bold', 'Nunito Sans Regular', 'Nunito Sans';font-weight:700;color:#D9001B;\">点击商品整块区域可进入商品详情页</span></p><p><span style=\"font-family:'Nunito Sans Bold', 'Nunito Sans Regular', 'Nunito Sans';font-weight:700;color:#D9001B;\"><br></span></p><p><span style=\"font-family:'Nunito Sans Bold', 'Nunito Sans Regular', 'Nunito Sans';font-weight:700;color:#D9001B;\"><br></span></p>",bh="9",bi="b2d1dc3b8bba4a1192610dea2a5c1936",bj="<p><span>点击可弹出属性规格框，可编辑修改规格</span></p><p><span>修改后对应价格、数量、商品规格图片对应变更</span></p>",bk="10",bl="5dfd0267960e405ba4d020fb8802a169",bm="<p><span><br></span></p><p><span><br></span></p><p><span>显示购买商品数量，最小默认单位为1。此处做增加或删减时，库存数字不做变化。</span></p><p><span>点击“-”：</span></p><p><span>1.当为默认值1时：置浅灰可点击，同时弹出弱提示“不能再少了哦”。</span></p><p><span>2.大于1时：数字相应减少。</span></p><p><span>点击“+”：</span></p><p><span>数字相应增加。（可增加数值小于商品库存）</span></p><p><span style=\"color:#0000FF;\">库存&lt;99</span><span>，达到库存最大值时，置浅灰可点击，同时弹出弱提示“已达上限数量”。</span></p><p><span style=\"color:#0000FF;\">库存&gt;99</span><span>，+置浅灰可点击，同时弹出弱提示“该商品最多购买99件”。</span></p><p><span>点击“数字”：弹出数字键盘。可进行输入。 </span><span style=\"color:#D9001B;\">（数量在键盘的上方可视输入</span><span>）</span></p><p><span>1.输入数值不可为负数（输入数值小于商品库存）</span></p><p><span>2.当输入数值为0时，弹出弱提示“至少1件哦” 默认为1。</span></p><p><span>3.</span><span style=\"color:#0000FF;\">库存&lt;99</span><span>当输入数值超过商品库存时，弹出弱提示“已达上限数量”，数值保留库存的最大量。</span></p><p><span>4.</span><span style=\"color:#0000FF;\">库存&gt;99，</span><span>当输入数值&gt;99时，弹出弱提示“该商品最多购买99件”，数值显示99。</span></p>",bn="11",bo="fe3236c7803d4a36bcce3dc9c58f741e",bp="失效商品（3）",bq="<p><span>购物车商品在结算前，库存为0时，商品下架，购物车列表内该商品状态变更为 售罄。</span></p><p><span>下架、整个商品所有sku库存不足 商品排在正常商品底部（多条下架商品时，按照下架时间进行排序）。</span></p><p><span>交互：</span></p><p><span>左划可删除。</span></p><p><span>点击无效。</span></p><p><span><br></span></p>",br="12",bs="19200a660ebd4e43b849b8d96b892de1",bt="清空",bu="<p><span>不显示失效商品标题</span></p>",bv="交互",bw="单击时:<br>&nbsp; &nbsp; 隐藏 清空无效的商品",bx="13",by="5e6ab31b53a94217bb09eb11e80fbdf6",bz